import React from 'react';
import "./progressBar.scss"

function ProgressBar(props) {



    console.log(props);
    return (
        
        <div className="progress-bar">
            <h1>New PR!</h1>
            <p>{props.exercises.muscle}</p>
        </div>
    );
}

export default ProgressBar;
